import * as React from "react";
import App from "./App";


import { createRoot } from "react-dom/client";
import {
  createBrowserRouter,
  RouterProvider,

} from "react-router-dom";


const router = createBrowserRouter([
  {
    path: "/",
    element: <App/>

  },
  {
    path:"about",
    element:<About/>
  },
  {
    path:"menu",
    element:<Menu/>
  }
  ,
  {
    path:"drinks",
    element:<Drinks/>
  }
  ,
  {
    path:"contact",
    element:<Contact/>
  },
  {
    path:"dessert",
    element:<Dessert/>
  }
]);

createRoot(document.getElementById("root")).render(
  <RouterProvider router={router} />
);
